<?phprequire_once("db.php");//  1 流量来源日志(front server记录)function parseSourceLog(&$arrRow){    global $arrResult, $arrPlace;	$req = json_decode($arrRow[4], true);    if ($req == false || empty($req)) {        return 1001;    }    if($req[imp][0]['banner']){        $w = intval($req["imp"][0]["banner"]['w']);        $h = intval($req["imp"][0]["banner"]['h']);    }else if($req[imp][0]['video']){        $w = intval($req["imp"][0]["video"]['w']);        $h = intval($req["imp"][0]["video"]['h']);    }else{        $w = 0;        $h = 0;    }    $placeId    = intval($req['imp'][0]['placeId']);       //广告位ID    $time	    = intval($req['ts']);  //时间戳    if(date("Y", $time) < 2017){        return 1002;    }    $date = date("Y-m-d", $time);    if($placeId < 1){        return 1003;    }    if(isset($arrPlace[$placeId]) == false){        return 1017;    }    $sellerId = intval($arrPlace[$placeId]['sellerId']);    $mediaId = intval($arrPlace[$placeId]['mediaId']);        $arrResult['adx_report_sell']["summary_day"][$date][$sellerId]["view"] ++;    $arrResult['adx_report_sell']["media_day"][$date][$mediaId]["view"] ++;    $arrResult['adx_report_sell']["place_day"][$date][$placeId]["view"] ++;    $arrResult['adx_report_sell']["size_day"][$date][$sellerId][$w][$h]["view"] ++;    $arrResult['adx_report_sell']["size_day"][$date][$sellerId][$w][$h]['w'] = $w;    $arrResult['adx_report_sell']["size_day"][$date][$sellerId][$w][$h]['h'] = $h;    return 1000;}